import React from 'react';
import { View, Text, FlatList } from 'react-native';
import repositories from '../data/repositories.js';

const Repositories = () => {
    return (
        <FlatList
            data={repo}
        >
            {
                repositories.map(repo => (
                    <View key={repo.id}>
                        <Text>
                            {repo.id}
                        </Text>
                        <Text>
                            {repo.fullName}
                        </Text>
                    </View>
                ))
            }
        </FlatList>
    );
};

export default Repositories;
